import { Agendamento } from "./agendamento/agendamento";

// interface IPaciente {}
export class Paciente {

    idPaciente: number = 0;
    cpf: string = '';
    nomePaciente: string = '';
    dataNascimentoPaciente: Date = new Date();
    idadePaciente: number = 0;
    cidade: string = '';
    estado: string = '';
    telefone: string = '';
    agendamento: Agendamento;

}
